let bivak = bivakzones.features;
export default getFeature = (bivakzone, i) => {

    if (bivakzone.properties[i] === undefined) {
        return false;
    } else {

        bivak = bivak.filter(Bivakzones => Bivakzones.properties[i]);
        return bivakzones.features;
    }
}





